-- myshop 데이터베이스 구조 내보내기
DROP DATABASE IF EXISTS `myshop`;
CREATE DATABASE IF NOT EXISTS `myshop` /*!40100 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci */;
USE `myshop`;

-- 테이블 myshop.categories 구조 내보내기
DROP TABLE IF EXISTS `categories`;
CREATE TABLE IF NOT EXISTS `categories` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '카테고리번호',
  `name` varchar(255) NOT NULL COMMENT '카테고리 이름',
  `reg_date` datetime NOT NULL DEFAULT current_timestamp() COMMENT '등록일시',
  `edit_date` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '변경일시',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='카테고리';

-- 테이블 데이터 myshop.categories:~10 rows (대략적) 내보내기

-- 테이블 myshop.members 구조 내보내기
DROP TABLE IF EXISTS `members`;
CREATE TABLE IF NOT EXISTS `members` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '일련번호',
  `user_id` varchar(30) NOT NULL COMMENT '아이디',
  `user_pw` varchar(255) NOT NULL COMMENT '비밀번호(암호화저장)',
  `user_name` varchar(30) NOT NULL COMMENT '회원이름',
  `email` varchar(255) NOT NULL COMMENT '이메일',
  `phone` varchar(20) NOT NULL COMMENT '연락처',
  `birthday` date NOT NULL COMMENT '생년월일',
  `gender` enum('M','F') NOT NULL COMMENT '성별(M=남자,F=여자)',
  `postcode` char(5) NOT NULL COMMENT '우편번호',
  `addr1` varchar(255) NOT NULL COMMENT '검색된 주소',
  `addr2` varchar(255) NOT NULL COMMENT '나머지 주소',
  `photo` varchar(255) DEFAULT NULL COMMENT '프로필사진 정보',
  `is_out` enum('Y','N') NOT NULL COMMENT '탈퇴여부(Y/N)',
  `is_admin` enum('Y','N') NOT NULL COMMENT '관리자 여부(Y/N)',
  `login_date` datetime DEFAULT NULL COMMENT '마지막 로그인 일시',
  `reg_date` datetime NOT NULL COMMENT '등록일시',
  `edit_date` datetime NOT NULL COMMENT '변경일시',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='회원';

-- 테이블 데이터 myshop.members:~0 rows (대략적) 내보내기

-- 테이블 myshop.products 구조 내보내기
DROP TABLE IF EXISTS `products`;
CREATE TABLE IF NOT EXISTS `products` (
  `id` int NOT NULL COMMENT '상품번호',
  `category_id` int(11) NOT NULL COMMENT '카테고리번호',
  `name` varchar(255) NOT NULL COMMENT '상품명',
  `price` int(11) NOT NULL COMMENT '상품가격',
  `discount` int(11) NOT NULL DEFAULT 0 COMMENT '할인율(%)',
  `summary` text DEFAULT NULL COMMENT '상품 요약설명',
  `image_url` text DEFAULT NULL COMMENT '상품 대표 이미지',
  `delivery_info` varchar(512) DEFAULT NULL COMMENT '배송정보',
  `product_url` text DEFAULT NULL COMMENT '상품 상세 URL',
  `reg_date` datetime NOT NULL DEFAULT current_timestamp() COMMENT '등록일시',
  `edit_date` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '변경일시',
  UNIQUE KEY `idx_product_id` (`id`),
  KEY `category_id` (`category_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='상품';

-- 테이블 데이터 myshop.products:~830 rows (대략적) 내보내기

-- 테이블 myshop.product_options 구조 내보내기
DROP TABLE IF EXISTS `product_options`;
CREATE TABLE IF NOT EXISTS `product_options` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '옵션번호',
  `product_id` int(11) NOT NULL COMMENT '상품번호',
  `name` varchar(255) NOT NULL COMMENT '옵션명',
  `value` varchar(255) NOT NULL COMMENT '옵션값',
  `reg_date` datetime DEFAULT current_timestamp() COMMENT '등록일시',
  `edit_date` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '변경일시',
  PRIMARY KEY (`id`),
  KEY `product_id` (`product_id`),
  CONSTRAINT `product_options_ibfk_1` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3643 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='상품 옵션';

-- 테이블 데이터 myshop.product_options:~3,642 rows (대략적) 내보내기

-- 테이블 myshop.SPRING_SESSION 구조 내보내기
DROP TABLE IF EXISTS `SPRING_SESSION`;
CREATE TABLE IF NOT EXISTS `SPRING_SESSION` (
  `PRIMARY_ID` char(36) NOT NULL,
  `SESSION_ID` char(36) NOT NULL,
  `CREATION_TIME` bigint(20) NOT NULL,
  `LAST_ACCESS_TIME` bigint(20) NOT NULL,
  `MAX_INACTIVE_INTERVAL` int(11) NOT NULL,
  `EXPIRY_TIME` bigint(20) NOT NULL,
  `PRINCIPAL_NAME` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`PRIMARY_ID`),
  UNIQUE KEY `SPRING_SESSION_IX1` (`SESSION_ID`),
  KEY `SPRING_SESSION_IX2` (`EXPIRY_TIME`),
  KEY `SPRING_SESSION_IX3` (`PRINCIPAL_NAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 myshop.SPRING_SESSION:~1 rows (대략적) 내보내기

-- 테이블 myshop.SPRING_SESSION_ATTRIBUTES 구조 내보내기
DROP TABLE IF EXISTS `SPRING_SESSION_ATTRIBUTES`;
CREATE TABLE IF NOT EXISTS `SPRING_SESSION_ATTRIBUTES` (
  `SESSION_PRIMARY_ID` char(36) NOT NULL,
  `ATTRIBUTE_NAME` varchar(200) NOT NULL,
  `ATTRIBUTE_BYTES` blob NOT NULL,
  PRIMARY KEY (`SESSION_PRIMARY_ID`,`ATTRIBUTE_NAME`),
  CONSTRAINT `SPRING_SESSION_ATTRIBUTES_FK` FOREIGN KEY (`SESSION_PRIMARY_ID`) REFERENCES `SPRING_SESSION` (`PRIMARY_ID`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

